Starborn 2010/11 By Stan Lee
#1-10
Boom comics
cbr

The most colossal creative force in the history of comics, Stan Lee, teams up with BOOM! Studios to deliver a brand new line of superhero comics, marking Stans explosive return to the direct market! Stan joins with critically-acclaimed writer Chris Roberson (iZombie, Do Androids Dream of Electric Sheep?: Dust to Dust) and fan-favorite artist Khary Randolph (Spider-Man) to present Stan Lees third, epic new ongoing series, Starborn! 

Benjamin Warner is a failed fantasy novelist, always dreaming of far off worlds and exciting adventures. But when a familiar face reenters his life, and devastating trouble follows, Benjamin learns his rejected stories were not fiction but memories of his home planet! Benjamins forgotten past comes crashing down around him as he finds himself at the center of a galactic war and is forced to face the truth that he is not of this world! With a cover by fan-favorite artist Humberto Ramos!
